<!DOCTYPE html>
<html lang="en" dir="ltr">
  <head>
    <meta charset="utf-8">
    <title></title>
  </head>
  <body>

    <script>
      let i = 11;
      while(i<=33){
        document.write(i + "<br \/>");
        i++
      }
      document.write("<br \/>");
      for(let k = 11; k<=33; k++){
        document.write(k + "<br \/>");
      }
    </script>
  </body>
</html>
